export const ANSWER_QUESTION = "ANSWER_QUESTION";
export const START_TIMER = "START_TIMER";
export const END_TIMER = "END_TIMER";

export function answerQuestion(answer: string, questionId: number) {
  return { type: ANSWER_QUESTION, answer, questionId };
}

export function startTimer(questionId: number) {
  return { type: START_TIMER, questionId };
}

export function endTimer(questionId: number) {
  return { type: START_TIMER, questionId };
}
